import React from 'react';
// import profileImg from './profile.jpg';

function Navbar() {
  return (
    <nav style={{ backgroundColor: '#1B223E', height: '60px', display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '0 20px', position: 'fixed', top: '0', width: '100%', zIndex: '1' }}>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <img src="https://via.placeholder.com/50x50.png?text=LOGO" alt="logo" style={{ marginRight: '10px' }} />
        <h2 style={{ color: 'white', margin: '0' }}>My Website</h2>
      </div>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'flex-end', marginRight: '20px' }}>
          <span style={{ color: 'white', fontSize: '14px', marginBottom: '5px' }}>John Doe</span>
          <img src={profileImg} alt="profile" style={{ width: '40px', height: '40px', borderRadius: '50%' }} />
        </div>
        <button style={{ backgroundColor: '#EE9179', color: 'white', border: 'none', borderRadius: '20px', padding: '10px 20px', fontSize: '14px', fontWeight: 'bold' }}>Sign Out</button>
      </div>
    </nav>
  );
}

export default Navbar;
